import React from 'react';
import './App.css'

class Profile {
  constructor(image, name, jobTitle, bio)
  {
    this.image = image;
    this.name = name;
    this.jobTitle = jobTitle;
    this.bio = bio;
  }
}

function App() {

  const profileList = [
    new Profile("images/woman-1.jpg", "Mary Swansea", "Operational Services and Management", "Hi, let's get to work on some business."),
    new Profile("images/man-1.jpg", "Jerry Percy", "Chief Resource Synergy", "The best thing in life are meetings."),
    new Profile("images/woman-2.jpg", "Susan Similar", "Communications and Telemetry", "Nice to see you!"),
    new Profile("images/man-1.jpg", "Terry Tales", "Admin", "Working."),
  ]

  return (
    <ProfileCard profile={profileList[0]}/>
  )
}

function ProfileCard(profile) {
  return (
    <div className="profile">
      <div className="identification">
        <img src={profile.image} alt={profile.name}/>
        <div className="personal-info">
          <h1>{profile.name}</h1>
          <h2>{profile.jobTitle}</h2>
        </div>
      </div>
      <p>{profile.bio}</p>
    </div>
  )
}

export default App;
